import tkinter as tk
from tkinter import ttk, filedialog, scrolledtext
import threading
import queue
import os
import webbrowser
import base64

from tile_downloader import TileDownloader

ICON_BASE64 = ""



class TileDownloaderGUI(tk.Tk):
    def __init__(self):
        super().__init__()
        self.title("Tile Downloader")
        self._set_app_icon()  # Set the icon at startup
        self.geometry("750x800")
        self.map_providers = {
            'Google Satellite': 'https://www.google.cn/maps/vt?lyrs=s@189&gl=cn&x={x}&y={y}&z={z}',
            'Open Street Map': 'https://tile.openstreetmap.org/{z}/{x}/{y}.png',
            'Open Topo Map': 'https://a.tile.opentopomap.org/{z}/{x}/{y}.png',
            'Google Map': 'https://mt1.google.com/vt/lyrs=r&x={x}&y={y}&z={z}',
            'Esri Satellite': 'https://server.arcgisonline.com/ArcGIS/rest/services/World_Imagery/MapServer/tile/{z}/{y}/{x}',
            'Esri World Topo': 'https://services.arcgisonline.com/ArcGIS/rest/services/World_Topo_Map/MapServer/tile/{z}/{y}/{x}',
            'Esri World Street Map': 'https://server.arcgisonline.com/ArcGIS/rest/services/World_Street_Map/MapServer/tile/{z}/{y}/{x}',
            'CartoDB Light': 'https://cartodb-basemaps-a.global.ssl.fastly.net/light_all/{z}/{x}/{y}.png',
            '2GIS': 'https://tile2.maps.2gis.com/tiles?x={x}&y={y}&z={z}&v=1.1',
            'Yandex Satellite': 'https://sat04.maps.yandex.net/tiles?l=sat&x={x}&y={y}&z={z}',
        }
        self.thread = None
        self.queue = queue.Queue()
        self.stop_event = threading.Event()
        self.apply_styles()
        self.create_widgets()
        self.process_queue()

    def _set_app_icon(self):
        """Sets the window icon from a base64 encoded string."""
        try:
            # Decode the base64 string to bytes
            image_bytes = base64.b64decode(ICON_BASE64)
            # Create a Tkinter PhotoImage directly from the bytes
            self.app_icon = tk.PhotoImage(data=image_bytes)
            # Set the icon for the window
            self.iconphoto(True, self.app_icon)
        except Exception as e:
            print(f"Warning: Could not set application icon. Error: {e}")

    def _collect_settings(self):
        """Collects all settings from the GUI widgets into a dictionary."""
        settings = {
            'url_template': self.url_template_var.get().strip(),
            'save_dir': self.save_dir_var.get().strip(),
            'zoom_levels_str': self.zoom_levels_var.get().strip(),
            'num_workers': self.num_workers_var.get(),
            'convert_webp': self.convert_webp_var.get(),
            'create_pmtiles': self.create_pmtiles_var.get(),
            'pmtiles_filename': self.pmtiles_filename_var.get().strip(),
            'delete_source_after_pmtiles': self.delete_source_var.get()
        }
        if self.notebook.index(self.notebook.select()) == 0:
            settings['mode'] = 'bbox'
            settings['bbox_str'] = {k: v.get() for k, v in self.bbox_vars.items()}
        else:
            settings['mode'] = 'geojson'
            settings['geojson_path'] = self.geojson_path_var.get().strip()
        return settings

    def _validate_settings(self, settings):
        """Validates the collected settings and logs errors if any."""
        if not all([settings['url_template'], settings['save_dir'], settings['zoom_levels_str']]):
            self.log("URL, Save Directory, and Zoom Levels cannot be empty.", "orange")
            return None

        try:
            settings['zoom_levels'] = self.parse_zoom_levels(settings['zoom_levels_str'])
            if not settings['zoom_levels']: return None
        except ValueError as e:
            self.log(str(e), "orange")
            return None

        if settings['create_pmtiles'] and not settings['pmtiles_filename']:
            self.log("PMTiles filename cannot be empty when creation is enabled.", "orange")
            return None

        if settings['mode'] == 'bbox':
            try:
                bbox_values = [
                    float(settings['bbox_str']['min_lat']),
                    float(settings['bbox_str']['min_lon']),
                    float(settings['bbox_str']['max_lat']),
                    float(settings['bbox_str']['max_lon'])
                ]
                settings['bbox'] = tuple(bbox_values)
            except ValueError:
                self.log("Bounding Box coordinates must be valid numbers.", "orange")
                return None
        else:  # geojson
            if not os.path.exists(settings['geojson_path']):
                self.log(f"GeoJSON file not found at: {settings['geojson_path']}", "orange")
                return None
        return settings

    def start_download(self):
        self.stop_event.clear()
        raw_settings = self._collect_settings()
        settings = self._validate_settings(raw_settings)
        if not settings:
            return

        self.start_button.config(state="disabled")
        self.stop_button.config(state="normal")
        self.progress_bar['value'] = 0
        self.progress_label.config(text="Starting...")
        self.log("Process started.", "lightblue")
        self.thread = threading.Thread(target=self.run_download_task, args=(settings,), daemon=True)
        self.thread.start()

    def stop_download(self):
        if self.thread and self.thread.is_alive():
            self.stop_event.set()
            self.stop_button.config(state="disabled")
            self.log("Stop signal sent. Finishing current tasks...", "yellow")

    def run_download_task(self, settings):
        error_occurred = False
        try:
            downloader = TileDownloader(settings['url_template'], settings['save_dir'],
                                        settings['num_workers'], settings['convert_webp'])

            def progress_callback(current, total, phase):
                self.queue.put(('progress', (current, total, phase)))

            if settings['mode'] == 'bbox':
                downloader.download_tiles_from_bbox(
                    bbox=settings['bbox'], zoom_levels=settings['zoom_levels'],
                    progress_callback=progress_callback, stop_event=self.stop_event,
                    create_pmtiles=settings['create_pmtiles'],
                    pmtiles_filename=settings['pmtiles_filename'],
                    delete_source_after_pmtiles=settings['delete_source_after_pmtiles']
                )
            else:  # geojson
                downloader.download_tiles_from_geojson(
                    geojson_input=settings['geojson_path'], zoom_levels=settings['zoom_levels'],
                    progress_callback=progress_callback, stop_event=self.stop_event,
                    create_pmtiles=settings['create_pmtiles'],
                    pmtiles_filename=settings['pmtiles_filename'],
                    delete_source_after_pmtiles=settings['delete_source_after_pmtiles']
                )

            if self.stop_event.is_set():
                self.queue.put(('log', ("Process stopped by user.", "yellow")))
            else:
                msg = f"PMTiles file created: {settings['pmtiles_filename']}" if settings[
                    'create_pmtiles'] else "Download completed."
                self.queue.put(('log', (msg, "lightgreen")))

        except Exception as e:
            error_occurred = True
            self.queue.put(('log', (f"An error occurred: {e}", "red")))
        finally:
            self.queue.put(('finished', error_occurred))

    def process_queue(self):
        try:
            message_type, data = self.queue.get_nowait()
            if message_type == 'progress':
                current, total, phase = data
                if total > 0:
                    percent = (current / total) * 100
                    self.progress_bar['value'] = percent
                    self.progress_label.config(text=f"{phase}: {current}/{total} ({percent:.1f}%)")
            elif message_type == 'log':
                msg, color = data
                self.log(msg, color)
            elif message_type == 'finished':
                error_occurred = data
                self.start_button.config(state="normal")
                self.stop_button.config(state="disabled")
                if self.stop_event.is_set():
                    self.progress_label.config(text="Process Stopped.")
                elif error_occurred:
                    self.progress_label.config(text="Finished with errors. Check log.")
                else:
                    self.progress_label.config(text="Process finished successfully.")
        except queue.Empty:
            pass
        finally:
            self.after(100, self.process_queue)

    def create_widgets(self):
        main_frame = ttk.Frame(self, padding="15")
        main_frame.pack(fill=tk.BOTH, expand=True)

        form_frame = ttk.Frame(main_frame)
        form_frame.pack(fill=tk.X, pady=(0, 15))
        ttk.Label(form_frame, text="Map Provider:").grid(row=0, column=0, sticky="w", pady=2)
        self.provider_combobox = ttk.Combobox(form_frame, values=list(self.map_providers.keys()), width=58,
                                              state="readonly")
        self.provider_combobox.grid(row=0, column=1, columnspan=2, sticky="ew")
        self.provider_combobox.set(list(self.map_providers.keys())[0])
        self.provider_combobox.bind('<<ComboboxSelected>>', self.on_provider_selected)
        ttk.Label(form_frame, text="Tile Server URL:").grid(row=1, column=0, sticky="w", pady=2)
        self.url_template_var = tk.StringVar()
        ttk.Entry(form_frame, textvariable=self.url_template_var, width=60).grid(row=1, column=1, columnspan=2,
                                                                                 sticky="ew")
        self.on_provider_selected()
        ttk.Label(form_frame, text="Save Directory:").grid(row=2, column=0, sticky="w", pady=2)
        self.save_dir_var = tk.StringVar(value=os.getcwd())
        ttk.Entry(form_frame, textvariable=self.save_dir_var, width=50).grid(row=2, column=1, sticky="ew")
        ttk.Button(form_frame, text="Browse...", command=self.browse_save_directory).grid(row=2, column=2, padx=(5, 0))
        form_frame.grid_columnconfigure(1, weight=1)

        self.notebook = ttk.Notebook(main_frame)
        self.notebook.pack(fill=tk.X, pady=5)
        bbox_tab = ttk.Frame(self.notebook, padding=10)
        self.notebook.add(bbox_tab, text="Bounding Box")

        self.bbox_vars = {key: tk.StringVar() for key in ['min_lon', 'max_lon', 'min_lat', 'max_lat']}
        self.bbox_vars['min_lon'].set('51.3');
        self.bbox_vars['max_lon'].set('51.5')
        self.bbox_vars['min_lat'].set('35.6');
        self.bbox_vars['max_lat'].set('35.8')

        ttk.Label(bbox_tab, text="Min Longitude:").grid(row=0, column=0, padx=5, pady=3, sticky="w")
        ttk.Entry(bbox_tab, textvariable=self.bbox_vars['min_lon'], width=15).grid(row=0, column=1, padx=5, pady=3)
        ttk.Label(bbox_tab, text="Max Longitude:").grid(row=0, column=2, padx=5, pady=3, sticky="w")
        ttk.Entry(bbox_tab, textvariable=self.bbox_vars['max_lon'], width=15).grid(row=0, column=3, padx=5, pady=3)
        ttk.Label(bbox_tab, text="Min Latitude:").grid(row=1, column=0, padx=5, pady=3, sticky="w")
        ttk.Entry(bbox_tab, textvariable=self.bbox_vars['min_lat'], width=15).grid(row=1, column=1, padx=5, pady=3)
        ttk.Label(bbox_tab, text="Max Latitude:").grid(row=1, column=2, padx=5, pady=3, sticky="w")
        ttk.Entry(bbox_tab, textvariable=self.bbox_vars['max_lat'], width=15).grid(row=1, column=3, padx=5, pady=3)

        geojson_tab = ttk.Frame(self.notebook, padding=10)
        self.notebook.add(geojson_tab, text="GeoJSON File")
        geojson_file_frame = ttk.Frame(geojson_tab)
        geojson_file_frame.pack(fill=tk.X)
        self.geojson_path_var = tk.StringVar()
        ttk.Entry(geojson_file_frame, textvariable=self.geojson_path_var, width=50).pack(side=tk.LEFT, fill=tk.X,
                                                                                         expand=True, padx=(0, 5))
        ttk.Button(geojson_file_frame, text="Browse...", command=self.browse_geojson_file).pack(side=tk.LEFT)

        settings_frame = ttk.Frame(main_frame)
        settings_frame.pack(fill=tk.X, pady=5)
        ttk.Label(settings_frame, text="Zoom Levels (e.g., 10-14, 16):").grid(row=0, column=0, sticky="w", pady=2)
        self.zoom_levels_var = tk.StringVar(value="10-12")
        ttk.Entry(settings_frame, textvariable=self.zoom_levels_var).grid(row=0, column=1, sticky="ew")
        ttk.Label(settings_frame, text="Number of Workers:").grid(row=1, column=0, sticky="w", pady=2)
        self.num_workers_var = tk.IntVar(value=10)
        ttk.Spinbox(settings_frame, from_=1, to=64, textvariable=self.num_workers_var).grid(row=1, column=1, sticky="w")
        self.convert_webp_var = tk.BooleanVar()
        ttk.Checkbutton(settings_frame, text="Convert to WEBP (saves space)", variable=self.convert_webp_var).grid(
            row=2, column=0, columnspan=2, sticky="w", pady=2)
        settings_frame.grid_columnconfigure(1, weight=1)

        pmtiles_frame = ttk.LabelFrame(main_frame, text="PMTiles Options", padding=10)
        pmtiles_frame.pack(fill=tk.X, pady=(5, 0))
        self.create_pmtiles_var = tk.BooleanVar(value=False)
        pmtiles_check = ttk.Checkbutton(pmtiles_frame, text="Create PMTiles file after download",
                                        variable=self.create_pmtiles_var, command=self._toggle_pmtiles_options)
        pmtiles_check.grid(row=0, column=0, columnspan=2, sticky="w")
        ttk.Label(pmtiles_frame, text="Output Filename:").grid(row=1, column=0, sticky="w", pady=2)
        self.pmtiles_filename_var = tk.StringVar(value="output.pmtiles")
        self.pmtiles_filename_entry = ttk.Entry(pmtiles_frame, textvariable=self.pmtiles_filename_var)
        self.pmtiles_filename_entry.grid(row=1, column=1, sticky="ew")
        self.delete_source_var = tk.BooleanVar(value=True)
        self.delete_source_check = ttk.Checkbutton(pmtiles_frame, text="Delete original tile files after creation",
                                                   variable=self.delete_source_var)
        self.delete_source_check.grid(row=2, column=0, columnspan=2, sticky="w", pady=2)
        pmtiles_frame.grid_columnconfigure(1, weight=1)
        self._toggle_pmtiles_options()

        controls_frame = ttk.Frame(main_frame)
        controls_frame.pack(fill=tk.X, pady=(10, 5))
        controls_frame.grid_columnconfigure(0, weight=1);
        controls_frame.grid_columnconfigure(1, weight=1)
        self.start_button = ttk.Button(controls_frame, text="Start Process", command=self.start_download)
        self.start_button.grid(row=0, column=0, sticky="ew", padx=(0, 5))
        self.stop_button = ttk.Button(controls_frame, text="Stop", command=self.stop_download, state="disabled")
        self.stop_button.grid(row=0, column=1, sticky="ew", padx=(5, 0))

        self.progress_bar = ttk.Progressbar(main_frame, mode='determinate', style='custom.Horizontal.TProgressbar')
        self.progress_bar.pack(fill=tk.X, pady=5)
        self.progress_label = ttk.Label(main_frame, text="Waiting to start...")
        self.progress_label.pack(fill=tk.X)
        self.log_area = scrolledtext.ScrolledText(main_frame, height=8, wrap=tk.WORD, bg=self.entry_bg,
                                                  fg=self.entry_fg, relief='flat')
        self.log_area.pack(fill=tk.BOTH, expand=True, pady=(10, 0))
        self.log_area.configure(state='disabled')
        footer_label = ttk.Label(main_frame, text="Developed by A-Talebifard | View on GitHub",
                                 style='Hyperlink.TLabel', cursor="hand2")
        footer_label.pack(side=tk.BOTTOM, pady=(10, 0))
        footer_label.bind("<Button-1>", self.open_github_link)

    def _toggle_pmtiles_options(self):
        state = "normal" if self.create_pmtiles_var.get() else "disabled"
        self.pmtiles_filename_entry.config(state=state)
        self.delete_source_check.config(state=state)

    def apply_styles(self):
        self.configure(bg="#2E2E2E")
        style = ttk.Style(self)
        style.theme_use('clam')
        self.bg_color, self.fg_color, self.entry_bg, self.entry_fg, self.button_bg, self.button_fg = "#2E2E2E", "#E0E0E0", "#3C3C3C", "#E0E0E0", "#007ACC", "white"
        style.configure('.', background=self.bg_color, foreground=self.fg_color, font=('Segoe UI', 10))
        style.configure('TLabel', background=self.bg_color, foreground=self.fg_color)
        style.configure('TButton', background=self.button_bg, foreground=self.button_fg, padding=6)
        style.map('TButton', background=[('active', '#005C99'), ('disabled', '#555555')])
        style.configure('TEntry', fieldbackground=self.entry_bg, foreground=self.entry_fg, borderwidth=1, relief='flat')
        style.configure('TSpinbox', fieldbackground=self.entry_bg, foreground=self.entry_fg)
        style.configure('TCheckbutton', background=self.bg_color, foreground=self.fg_color)
        style.configure('TFrame', background=self.bg_color)
        self.option_add("*TCombobox*Listbox*Background", self.entry_bg);
        self.option_add("*TCombobox*Listbox*Foreground", self.entry_fg)
        self.option_add("*TCombobox*Listbox*selectBackground", self.button_bg);
        self.option_add("*TCombobox*Listbox*selectForeground", self.button_fg)
        style.configure('custom.Horizontal.TProgressbar', troughcolor=self.entry_bg, background=self.button_bg,
                        borderwidth=0)
        style.configure("TNotebook", background=self.bg_color, borderwidth=0)
        style.configure("TNotebook.Tab", background="#444444", foreground=self.fg_color, padding=[10, 5], borderwidth=0)
        style.map("TNotebook.Tab", background=[("selected", self.entry_bg)])
        style.configure('Hyperlink.TLabel', foreground='#64B5F6')

    def on_provider_selected(self, event=None):
        provider_name = self.provider_combobox.get()
        url = self.map_providers.get(provider_name)
        if url: self.url_template_var.set(url)

    def open_github_link(self, event):
        webbrowser.open_new_tab("https://github.com/A-talebifard/tile-downloader")

    def browse_save_directory(self):
        path = filedialog.askdirectory(initialdir=self.save_dir_var.get())
        if path:
            self.save_dir_var.set(path)
            self.log(f"Save directory set to: {path}", "gray")

    def browse_geojson_file(self):
        path = filedialog.askopenfilename(filetypes=[("GeoJSON files", "*.geojson *.json")])
        if path:
            self.geojson_path_var.set(path)
            self.log(f"GeoJSON file selected: {path}", "gray")

    def parse_zoom_levels(self, text):
        levels = set()
        parts = text.replace(' ', '').split(',')
        for part in parts:
            if not part: continue
            if '-' in part:
                try:
                    start, end = map(int, part.split('-'))
                    if start > end: start, end = end, start
                    levels.update(range(start, end + 1))
                except ValueError:
                    raise ValueError(f"Invalid zoom range: {part}")
            else:
                try:
                    levels.add(int(part))
                except ValueError:
                    raise ValueError(f"Invalid zoom level: {part}")
        return sorted(list(levels))

    def log(self, message, color="white"):
        self.log_area.configure(state='normal')
        self.log_area.insert(tk.END, message + "\n")
        self.log_area.see(tk.END)
        self.log_area.tag_add(color, "end-2l", "end-1c")
        self.log_area.tag_config(color, foreground=color)
        self.log_area.configure(state='disabled')


def main():
    app = TileDownloaderGUI()
    app.mainloop()


if __name__ == '__main__':
    main()

